  false,\n\t\"url\": null,\n\t\"notes\": \"Spring and fall aerial surveys and a ground
  species identification survey were conducted on the Nowitna NWR in 1987. Totals
  of 158 swans and 38 nests were observed during the spring survey. Total swans increased
  17.1% and the number of nests 34.9% over 1986 on 15 survey units surveyed both years.
  One hundred and fifty-three swans, including 64 juveniles, were observed during
  the fall survey. The number of juveniles increased 88.1% over 1985 on 5 survey units
  surveyed both years. All swans identified to species during the ground survey were
  trumpeter swans.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
